<BR><FONT SIZE=6><B>別売オプション</B></FONT>
<br><FONT SIZE=2>
<b>●保護シート：EA19（4枚入り）</b>
<br>　キャリア装着時にルーフを保護するための透明シートです。
<BR>
<BR>※システムキャリア装着時の参考寸法はあくまで目安です。車両によっては若干寸法が前後する場合があります。またキャリアのバー下MIN寸法は車両のルーフとメインバーの間で最も狭い位置での数値のため、アタッチメント装着時必要バー下寸法より狭い場合でも取り付ける位置によっては装着できる事がありますので予めご了承ください。
<BR>※車両やキャリアによってはサンルーフやアンテナを利用できない場合がありますのでご注意ください。
<BR>※車種によってはサイドバイザーとキャリアを併用できない場合がありますので、その場合はサイドバイザーを取り外してからキャリアの取り付けを行ってください。
<BR>※積載荷量目安はあくまで目安です。積載の際は過積載や荷物の片寄りの無いよう充分ご注意ください。
</FONT>


